import React from 'react';
import "../Asserts/Css/ComponentsCss/h1balternative.css";
import H1Bvisa from "../Asserts/images/H1Bvisa.png";

const HlBAternative = () => {
  return (
    
      <div className="h1balternativecomponents">
        {" "}
       <a href='/h1balternative'></a> <img className='h1balternativeimg' src={H1Bvisa} width="320px" height="274px" ></img>{" "}
        <p className="h1balternativeone">Business Visa</p>
        <p className='h1balternativetwo'>J1 Cultural Exchange Programs offer students, university graduates and young professionals an enriching opportunity to enhance their lives and careers with the experience of living and working in the United States. </p>
      </div>
    
  );
};

export default HlBAternative ;
